import React from "react";
import TextField from "@material-ui/core/TextField";
import { generateLabel, generateName } from "./utils";

const ATextField = (props) => {

  const name=generateName(this.props.name, this.props.label);

  textFieldProps = {
    id: name,
      name: name,
      label:generateLabel(this.props.label, this.props.name),
      value:props.value
  }

  return (
    <TextField
      {...textFieldProps}
    />
  );
};

export default ATextField;
